  }

  render(){
    return (
      <Router>
        <Container fluid = {true} className = "p-4 pl-6 pr-6">
          {/* <Row className="justify-content-center"> */}
            {/* <Col md = {11} sm = {11} xs = {12}> */}
              <Navbar className="ml-2" bg="white" expand="lg">


                <Navbar.Brand className = "nav-link" to = "/">Shashank Ginjpalli</Navbar.Brand>

                <Nav className="ml-auto mr-2">
                  <Link className="nav-link" to="/resume">Resum√©</Link>
                </Nav>

              </Navbar>
            {/* </Col> */}

          {/* </Row> */}

        </Container>

        <Route path='/' exact render={() => <Home />} />
      </Router> 
    );
  }
}

export default App;
